import { useState, useEffect } from "react";
import "./StarApi.css"
type resultProps = {
    name: string, 
    height: number, 
    mass: string, 
    hair_color:string, 
    skin_color: string, 
    eye_color: string, 
    birth_year: string, 
    gender: string, 
    homeworld: string, 
};

 const StarApi=()=> {
  const [result, setResult] = useState<resultProps[]>([]);

  useEffect(() => {
    const fectchApi = async () => {
      const data = await fetch("https://swapi.dev/api/people/", {
        method: "GET"
      });
      const jsonData = await data.json();
      setResult(jsonData.results);
    };

    fectchApi();
  }, []);

  return (
    <div className="App">
      <h1>
        {result.map((value) => {
          return (
            <div className="responsiveLayout">
                <div>
                <span>{value.name}</span>
              <span>{value.gender}</span>
                </div>

            </div>
          );
        })}
      </h1>

    </div>
  );
}

export default StarApi;
